import React, { useState } from 'react'
import Header from '../Header'
import LeftNav from '../LeftNav'
import profile from '../../images/blanket.jpeg';
// import PropTypes from 'prop-types'
import {Card, Table, Container, Button} from 'react-bootstrap';
import "../style.css";
import { Form } from 'react-bootstrap'
import { Link } from 'react-router-dom';
import axios from "axios";


const EditProfile = () => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    const getItems = async () => {
      try {
        const res = await axios.post("http://localhost:8800/getProfile", {
          uid: sessionStorage.getItem("token"),
        });
        setItems(res.data);
      } catch (err) {
        console.log(err);
      }
    };
    getItems();
  }, []);


  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [[pass], setPass] = useState("");
  const [picture, setPicture] = useState([]);

  const submit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:8800/updateProfile", {
        uid: sessionStorage.getItem('token'),
        email: email,
        phone: phone,
        pass: pass,
        picture: picture
      });
    } catch (err) {
      console.log(err);
    }
    window.location.replace('/MyProfile');
  }

  return (
    <div>
        <Form>
      <Header />
      <LeftNav />
      <div className='myProfileDetails'>
        <Card className='border-1 rounded-0 shadow-sm'>
          <Card.Body>
            <h3>Personal Details</h3>
              <Table responsive striped hover bordered={true} className='text-center mt-3'>
                <tbody>
                  <tr>
                  <td>NAME</td>
                  <td>Garvit Jain</td>
                </tr>
                <tr>
                  <td>EMAIL</td>
                  <td><Form.Control type='text' name='email' id='changeEmail' onChange={(e) => setEmail(e.target.value)} defaultValue={items.email} /></td>
                </tr>
                <tr>
                  <td>DATE OF BIRTH</td>
                  <td></td>
                </tr>
                <tr>
                  <td>USERNAME</td>
                  <td></td>
                </tr>
                <tr>
                  <td>PHONE NUMBER</td>
                  <td><Form.Control type='text' name='phone' id='phone'  onChange={(e) => setPhone(e.target.value)} defaultValue={items.phone} /></td>
                </tr>
                <tr>
                  <td>PASSWORD</td>
                  <td><Form.Control type='password' name='pass' id='changePass'  onChange={(e) => setPass(e.target.value)} defaultValue={items.password} /></td>
                </tr>
                <tr>
                  <td>PROFILE PICTURE</td>
                  <td><Form.Control type='file' onChange={(e) => {
          const [file] = e.target.files;
          setPicture((picture) => [...picture, file]);
        }}/></td>
                </tr>
                </tbody>
              </Table>
          </Card.Body>
          <Card.Footer style={{textAlign: 'right'}}>
          <Link to='/MyProfile'><Button variant='danger' style={{marginRight: '1%'}}>Cancel</Button></Link>
          <Link to='/MyProfile'><Button  variant='primary' onClick={submit}>Save Changes</Button></Link>
          </Card.Footer>
        </Card>
      </div>
      <div className='ProfilePic'>
        <Container className='text-center mt-5 mr-2 pd-2'>
          <img src ={profile} style={{ maxWidth: '200px', maxHeight: '200px' }} alt = "profile" />
        </Container>
        
      </div>
      </Form>
    </div>
  )
}

export default EditProfile
